import React from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import * as serviceWorker from './serviceWorker';
import RouteZero from './Routes/0_Route';
import RouteOne from './Routes/1_Route';
import Nav from './components/Nav';

const routing = (
  <Router>

    <Switch>
      <div>
        <Route exact path="/route-0" component={RouteZero} />
        <Route path="/route-1" component={RouteOne} />
        <Route  component={RouteZero} />
      </div>
    </Switch>
    <Nav />
  </Router>
)


ReactDOM.render(routing, document.getElementById('root'));

// If you want your RouteZero to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
